import React from 'react';
import {Link} from 'react-router-dom'


// KOMPONENT  WYSWIETLAJACY MENU //

class AppHeader extends React.Component {
  

 
  render() {
    return(
      <div className='App-Menu'>
        <Link className="button" to="/">Homepage</Link>
        <Link to="/findsound">Find Sound</Link>
        <Link to="/findartist">Find Artist</Link>
        <Link to="/findgenres">Find Genres</Link>
        <Link to="/findalbum">Find Album</Link>
        <Link to="/favourite">Favourite</Link>
      </div>
    )
  }
}

export default AppHeader;
